import React from 'react';

const MenuToggler = () => {

    return (
        <svg className="menutoggler" height="30" width="45" viewBox="0 0 30 12">
            <rect width="30" height="2"/>
            <rect x="8" y="6" width="22" height="2"/>
            <rect x="18" y="12" width="12" height="2"/>
        </svg>
    )
}

export default MenuToggler;
